import React from 'react';
import './Header.css';
import avatar from '../../asset/images/PixelAvatar.png';

const Header = () => {
    return (
        <header className='header'>

            <section className='avatarHeader'>
                <img src={avatar} alt="" />
            </section> 
        </header>
    );
};

export default Header;
